import slender from './images/slender.png';
import sporty from './images/sporty.png';
import stocky from './images/stocky.png';
import striped from './images/striped.png';
import spotted from './images/spotted.png';



export {
    patchy,
    plain,
    skinny,
    slender,
    sporty,
    spotted,
    stocky,
    striped
